import React from 'react';
import { Tab } from '@headlessui/react';
import {
  DocumentTextIcon,
  ShieldCheckIcon,
  ExclamationTriangleIcon,
  DocumentMagnifyingGlassIcon,
} from '@heroicons/react/24/outline';

function classNames(...classes) {
  return classes.filter(Boolean).join(' ');
}

const AnalysisResults = ({ results }) => {
  if (!results) return null;

  const { compliance_report, entities, summary } = results;

  const tabs = [
    {
      name: 'Summary',
      icon: DocumentTextIcon,
      content: (
        <div className="prose max-w-none">
          <h3 className="text-lg font-medium text-gray-900">Document Summary</h3>
          <p className="mt-2 text-gray-600">{summary}</p>
        </div>
      ),
    },
    {
      name: 'Compliance',
      icon: ShieldCheckIcon,
      content: (
        <div>
          <h3 className="text-lg font-medium text-gray-900">Compliance Analysis</h3>
          <div className="mt-4 grid grid-cols-1 gap-4 sm:grid-cols-2">
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="px-4 py-5 sm:p-6">
                <dt className="text-sm font-medium text-gray-500 truncate">Risk Level</dt>
                <dd className={`mt-1 text-3xl font-semibold ${
                  compliance_report.summary.risk_level === 'High' ? 'text-red-600' :
                  compliance_report.summary.risk_level === 'Medium' ? 'text-yellow-600' :
                  'text-green-600'
                }`}>
                  {compliance_report.summary.risk_level}
                </dd>
              </div>
            </div>
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="px-4 py-5 sm:p-6">
                <dt className="text-sm font-medium text-gray-500 truncate">Missing Clauses</dt>
                <dd className="mt-1 text-3xl font-semibold text-gray-900">
                  {compliance_report.summary.missing_clauses_count}
                </dd>
              </div>
            </div>
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="px-4 py-5 sm:p-6">
                <dt className="text-sm font-medium text-gray-500 truncate">PPE Update Status</dt>
                <dd className="mt-1 text-3xl font-semibold text-gray-900">
                  {compliance_report.summary.ppe_update_status}
                </dd>
              </div>
            </div>
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="px-4 py-5 sm:p-6">
                <dt className="text-sm font-medium text-gray-500 truncate">Emergency Drill Status</dt>
                <dd className="mt-1 text-3xl font-semibold text-gray-900">
                  {compliance_report.summary.drill_status}
                </dd>
              </div>
            </div>
          </div>
        </div>
      ),
    },
    {
      name: 'Gaps',
      icon: ExclamationTriangleIcon,
      content: (
        <div>
          <h3 className="text-lg font-medium text-gray-900">Missing ADNOC HSE 2023 Clauses</h3>
          <div className="mt-4 space-y-4">
            {compliance_report.adnoc_hse_compliance.missing_clauses.map((clause, index) => (
              <div
                key={index}
                className="bg-white shadow sm:rounded-lg"
              >
                <div className="px-4 py-5 sm:p-6">
                  <h4 className="text-base font-semibold text-gray-900">
                    {clause.category.toUpperCase()}
                  </h4>
                  <p className="mt-2 text-gray-700">{clause.clause}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      ),
    },
    {
      name: 'Entities',
      icon: DocumentMagnifyingGlassIcon,
      content: (
        <div>
          <h3 className="text-lg font-medium text-gray-900">Extracted Entities</h3>
          <div className="mt-4 grid grid-cols-1 gap-4 sm:grid-cols-2 lg:grid-cols-3">
            {entities.map((entity, index) => (
              <div
                key={index}
                className="bg-white overflow-hidden shadow rounded-lg"
              >
                <div className="px-4 py-5 sm:p-6">
                  <dt className="text-sm font-medium text-gray-500 truncate">
                    {entity.label}
                  </dt>
                  <dd className="mt-1 text-sm text-gray-900">
                    {entity.text}
                  </dd>
                </div>
              </div>
            ))}
          </div>
        </div>
      ),
    },
  ];

  return (
    <div className="mt-8">
      <div className="bg-white shadow rounded-lg p-6">
        <h2 className="text-2xl font-bold text-gray-900 mb-6">Analysis Results</h2>

        <Tab.Group>
          <Tab.List className="flex space-x-1 rounded-xl bg-gray-100 p-1">
            {tabs.map((tab) => (
              <Tab
                key={tab.name}
                className={({ selected }) =>
                  classNames(
                    'w-full rounded-lg py-2.5 text-sm font-medium leading-5',
                    'ring-white ring-opacity-60 ring-offset-2 ring-offset-blue-400 focus:outline-none focus:ring-2',
                    selected
                      ? 'bg-white shadow text-blue-700'
                      : 'text-gray-600 hover:bg-white/[0.12] hover:text-gray-800'
                  )
                }
              >
                <div className="flex items-center justify-center space-x-2">
                  <tab.icon className="h-5 w-5" />
                  <span>{tab.name}</span>
                </div>
              </Tab>
            ))}
          </Tab.List>
          <Tab.Panels className="mt-6">
            {tabs.map((tab, idx) => (
              <Tab.Panel
                key={idx}
                className={classNames(
                  'rounded-xl bg-white p-6',
                  'ring-white ring-opacity-60 ring-offset-2 ring-offset-blue-400 focus:outline-none focus:ring-2'
                )}
              >
                {tab.content}
              </Tab.Panel>
            ))}
          </Tab.Panels>
        </Tab.Group>
      </div>
    </div>
  );
};

export default AnalysisResults;
